import React, {Component} from 'react';
import "../style/css-final.css";
import "../style/bootstrap.min.css";

class Berita1 extends Component{
    render(){
        return(
            <div class="col-md-7">
                <div class="col-md-12 kotak">
                    <div class="col-md-12 profil">
                        <img src={require("./img/logo192.png")} alt=""/>
                        <p>Hedy Gading</p>
                    </div>
                    <div class="col-md-12 gambar">
                        <img src={require("../img/PurnamaSyafitriManurung.JPG")} alt=""/>
                    </div>
                    <div class="col-md-12">
                        <div class="col-md-12 judul">
                            <p>7 Tanda-Tanda Kiamat Besar yang Sudah Terjadi di Zaman Rasul</p>
                        </div>
                        <div class="col-md-12 pendek">
                            <p>huahahaha</p>
                        </div>
                        <div class="col-md-12 waktu">
                            <p class="waktu">besok</p>
                        </div>
                    </div>
                </div>
            </div>        
        );
    }
}

export default Berita1;
